import React, { useState } from "react";
import axios from "axios";


const Recommend = () => {
    const url = 'http://localhost:5000/food/analyze/?p1=1&p2=2&p3=3&p4=4';
    const [recommends, setProduct] = useState(null);


    axios.get(url, {
        headers: {
            "Access-Control-Allow-Origin": "*"
        }
    })
        .then(response => {
            setProduct(response.data)
        })

    console.log(recommends)
    return ( 
        <div>
            <h1>Done!</h1>
        </div>
     );
}
 
export default Recommend;
